    "desoto-national-wildlife-refuge-narrative-report-for-january-february-march-april-1963",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for DeSoto National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1963.
    The report begins by summarizing the weather conditions, habitat conditions, water
    conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, furbearers, predators, rodents, raptors,
    and fish- is also covered. The Refuge development and maintenance section discusses
    physical developments, plantings, vegetation control, and collections and receipts.
    A progress report on field investigations and applied research is also provided.
    The public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, and safety. Items of interest, N-R forms, and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
